import React from 'react';
import './StickyNote.css';

const StickyNote = (props) => {
    if(props.color === ""){
        alert("Insira uma cor");
    }
    return (
        <div className={`sticky ${props.color}`}>
            {props.children}
        </div>
      );
}

export default StickyNote;
